		//this.drawFrame(nextTime);
		//this.currentTime = nextTime;
		var nextTime = this.currentTime + 1;
		this.currentTime = nextTime;
		var heatpoints = [];
		heatpoints.push(new google.maps.LatLng(this.data[nextTime][0], this.data[nextTime][1]));
		var pointArray = new google.maps.MVCArray(heatpoints);
		currentData = this.data[nextTime];
